import { Connection } from '@salesforce/core';

export async function getNumberOfMembers(
  connection: Connection,
  Package2VersionId: string,
  subjectKeyPrefix: string
): Promise<number> {
  const query = `SELECT COUNT(Id) FROM ReleasedEntityState WHERE Package2VersionId = '${Package2VersionId}' AND SubjectKeyPrefix = '${subjectKeyPrefix}'`;
  const result = await connection.tooling.query(query);
  return result.totalSize;
}

export async function getSizeInBytes(connection: Connection, packageVersionId: string): Promise<number> {
  const query = `SELECT TotalSizeOfMetadataFiles FROM Package2Version WHERE Id = '${packageVersionId}'`;
  const result = await connection.tooling.query(query);
  return (result.records[0]?.TotalSizeOfMetadataFiles as number) || 0;
}

export async function predictPackageUpgradeRunTime(
  connection: Connection,
  subscriberPackageVersionId: string
): Promise<number> {
  // Get Package2Version Id from SubscriberPackageVersionId
  const package2VersionQuery = `SELECT Id FROM Package2Version WHERE SubscriberPackageVersionId = '${subscriberPackageVersionId}'`;
  const package2VersionResult = await connection.tooling.query(package2VersionQuery);
  const package2VersionId = package2VersionResult.records[0]?.Id as string;

  // Get size in bytes
  const sizeBytes = await getSizeInBytes(connection, subscriberPackageVersionId);

  // Get member counts for each metadata type with their corresponding prefixes
  const layoutCount = await getNumberOfMembers(connection, package2VersionId, '00h');
  const apexClassCount = await getNumberOfMembers(connection, package2VersionId, '400');
  const ValidationRuleCount = await getNumberOfMembers(connection, package2VersionId, '405');
  const lightningComponentBundleCount = await getNumberOfMembers(connection, package2VersionId, '0Rb');

  // Prepare input array in the order expected by the model:
  // sizeBytes, Layout, ApexClass, ValidationRule, LightningComponentBundle
  const input = [sizeBytes, layoutCount, apexClassCount, ValidationRuleCount, lightningComponentBundleCount];

  // Call the XGBoost prediction model
  return xgbPredictRunTime(input);
}

